param_grid_elastic = {
    'max_iter': [1000],
    'alpha': np.arange(0.0, 1.0, 0.1),
    'l1_ratio': np.arange(0.0, 1.0, 0.1)
}

# Create an ElasticNet model
elastic_reg = ElasticNet(random_state=999)

# Create a GridSearchCV object
